import './App.css';


const MainPage = () => {


    return (
        <Grid container className="App-header">
            <Grid container direction="row">
                <Grid item xs={4} display="flex" justifyContent="center" alignItems="center">
                    <IconButton><KeyboardBackspaceIcon sx={{ fontSize: 100 }}/></IconButton>
                </Grid>
                <Grid item xs={8} display="flex" justifyContent="center" alignItems="center">
                    <Typography style={{color: 'white', textAlign: 'center', fontSize: '2rem'}}>BENVENUTO USER</Typography>
                </Grid>
            </Grid>
        </Grid>
    );

}

export default MainPage;
